import Product from './product';

const Products = () => (
    <section className="products">
        <Product imgName="product_4.png" prodTitle="TITLE 4" prodDisc="Dummy TEXT" style="left" />
        <Product_1 imgName="product_1.png" prodTitle="TITLE 1" prodDisc="Dummy TEXT" style="right"/>
        <Product imgName="product_2.png" prodTitle="TITLE 2" prodDisc="Dummy TEXT" style="left" />
        <Product_1 imgName="product_3.png" prodTitle="TITLE 3" prodDisc="Dummy TEXT" style="right"/>
    </section>
)

export default Products
